import React from "react";

function createNote(newNote) {
  return (
    <notes id={newNote.id} title={newNote.title} content={newNote.content} />
  );
}
function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

export default Note;
